package com.wolken.wolkenapp.DTO;

public class VoterDetailsDTO {

	private String voterName;
	private String voterPlace;
	private int voterAge;
	
	public VoterDetailsDTO() {
		// TODO Auto-generated constructor stub
	}

	public String getVoterName() {
		return voterName;
	}

	public void setVoterName(String voterName) {
		this.voterName = voterName;
	}

	public String getVoterPlace() {
		return voterPlace;
	}

	public void setVoterPlace(String voterPlace) {
		this.voterPlace = voterPlace;
	}

	public int getVoterAge() {
		return voterAge;
	}

	public void setVoterAge(int voterAge) {
		this.voterAge = voterAge;
	}
	
	
	
	
}
